import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { RouterModule } from '@angular/router';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';

import { AppComponent } from './app.component';
import { TopBarComponent } from './top-bar/top-bar.component';
import { ProductListComponent } from './product-list/product-list.component';
import { ProductAlertsComponent } from './product-alerts/product-alerts.component';
import { ProductDetailsComponent } from './product-details/product-details.component';
import { HttpClientModule } from '@angular/common/http';
import { RegisterCalifComponent } from './register-calif/register-calif.component';
import { UpdateCalifComponent } from './update-calif/update-calif.component';

@NgModule({
  imports: [
    BrowserModule,
    FormsModule,
    HttpClientModule,
    ReactiveFormsModule,
    RouterModule.forRoot([
      { path: '', component: ProductListComponent },
      { path: 'kardex/:alumnoId', component: ProductDetailsComponent },
      { path: 'registrar/:alumnoId', component: RegisterCalifComponent },
      { path: 'actualizar/:alumnoId', component: ProductDetailsComponent },
    ])
  ],
  declarations: [
    AppComponent,
    TopBarComponent,
    ProductListComponent,
    ProductAlertsComponent,
    ProductDetailsComponent,
    RegisterCalifComponent,
    UpdateCalifComponent,
  ],
  bootstrap: [
    AppComponent
  ]
})
export class AppModule { }
